import React, { Component } from 'react';
import './App.css';
import {Route} from 'react-router-dom'
import Data from './data/Data'
import MainSidebar from './main/MainSidebar'
import FolderMain from './folder/FolderMain'
import MainMain from './main/MainMain'

class App extends Component {
  constructor(props){
    super(props)
    this.state={
      folders:Data.folders,
      note:Data.notes
    }

  }



  componentDidMount(){
    setTimeout(() => this.setState(Data), 600)
  }

  render() {
    //console.log(FolderMain)
    return (
      <div className="App">
        <header>
          <h1>Noteful</h1>
        </header>
        <nav>
        <Route path='/' component={MainSidebar} />
        </nav>

        <main>
          <Route path='/' component={MainMain}/>
          <Route exact path='/folder/:folderId' component={FolderMain}/>

        </main>
      </div>
    );
  }
}

export default App;
